def apply_along_axis(func1d, axis, arr, *args, **kwargs):
    if not isinstance(arr, ndarray):
        raise ValueError("Input 'arr' must be a NumPy array")

    axis = axis % arr.ndim  # Normalize axis to be within the range of array dimensions

    inds = [slice(None)] * arr.ndim
    outshape = list(arr.shape)
    outshape[axis] = 1

    outarr = np.empty(outshape, dtype=object)

    for ind in itertools.product(*[range(i) for i in arr.shape]):
        inds[axis] = slice(None)
        inds[axis] = ind[axis]
        outarr[tuple(ind)] = func1d(arr[tuple(inds)], *args, **kwargs)

    return np.array(outarr)

