def polyfit(x, y, deg, rcond=None, full=False, w=None, cov=False):
    if isinstance(y, ndarray) and y.ndim == 2:
        y = y.squeeze()
    if w is not None:
        w = nxarray(w)
    V = np.vander(x, deg + 1)
    if w is not None:
        V = V * np.sqrt(w)[:, np.newaxis]
    c, resids, rank, s = np.linalg.lstsq(V, y, rcond)
    c = c[::-1]
    if cov or full:
        if w is None:
            A = np.dot(V.T, V)
            C = np.linalg.inv(A)
        else:
            C = np.linalg.inv(np.dot(V.T / w, V))
    if full:
        return c, resids, rank, s, rcond, C
    if cov:
        return c, C
    return c

