def _zseries_to_cseries(zs):
    n = len(zs)
    if n == 1:
        return zs
    elif n == 3:
        return np.array([zs[0], zs[1] - zs[2]])
    else:
        A = np.zeros((n, n))
        A[0, 0] = 1
        A[1, 1] = 1
        A[2, 2] = 1
        A[3, 3] = 1
        for i in range(4, n):
            for j in range(0, i-2):
                A[i, j] = 2 * zs[i-1] * A[i-1, j] - A[i-2, j]
            A[i, i-1] = zs[i-1] * A[i-1, i-1] - A[i-2, i-1]
            A[i, i] = zs[i-1] * A[i-1, i] - A[i-2, i]
        c = la.solve(A, zs)
        return c

