def _aligned_zeros(shape, dtype=float, order='C', align=None):
    if align is None:
        align = np.dtype(dtype).alignment
    data = np.empty(shape, dtype, order)
    if align > 1:
        extra = (align - data.ctypes.data % align) % align
        data = np.zeros(shape + (extra,), dtype, order)
    return data

