def repmat(a, m, n):
    if isinstance(a, (int, float)):
        return np.tile(a, (m, n))
    elif isinstance(a, np.ndarray) or isinstance(a, matrix) or isinstance(a, asmatrix):
        return np.tile(a, (m, n))
    else:
        warnings.warn("Input type not supported. Returning None.")
        return None

